class Loader {
    constructor() {
        this.loaded = false;
    }

    ensureLoaded() {
        return new Promise((resolve) => {
            if (this.loaded) {
                return resolve(true);
            }
            let script = document.createElement('script');
            script.onload = () => {
                return resolve(true);
            };
            script.src = 'https://static.bistudio.com/ckeditor/4.10.1/ckeditor.js';

            document.head.appendChild(script);
        })
    }
}
export default new Loader();
